import React from "react";

import TransferIntraAgency from "./Sections/TransferIntraAgency.jsx"

// reactstrap components
import {
  Card,
  CardHeader,
  CardBody,
  Row,
  Col
} from "reactstrap";

import "bootstrap/dist/css/bootstrap.css";

class Transfer extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
        <>
          <div className="content">
            <Row>
              <Col md="12">
                <Card>
                  <CardHeader>
                    <h4 className="title">Saisie du virement</h4>
                  </CardHeader>
                  <CardBody>
                    <Row>
                      <Col md="2"></Col>
                      <Col md="8">
                        {/* Virement INTRA en agence*/}
                        <TransferIntraAgency notify={(place,type,message) => this.props.notify(place,type,message)} />
                      </Col>
                      <Col md="2"></Col>
                    </Row>
                  </CardBody>
                </Card>
              </Col>
            </Row>
          </div>
        </>
    );
  }
}
export default Transfer;
